    super(); /* Calls constructor of class you are extending i.e Component*/
    this.state = {
      name: { firstName: "Yihua", lastName: "Zhang" },
      company: "ZTM",
    };
  }

  render() {
    return <div className="App"></div>;
  }
}

export default App;
